import React from 'react';

import LessonDisplay from './LessonDisplay';

import './styles.scss';

const testData = [1,2,3,4,5,8,9]

export default function LessonWrapper() {
    return(
        <div className="lesson-wrapper">
            {
                testData.map((index) => (
                    <LessonDisplay key={index} />
                ))
            }
        </div>
    );
}
